class Solution:    def findRelativeRanks(self, nums):        """        :type nums: List[int]        :rtype: List[str]        """        n = len(nums)        if n == 0:            return        if n == 1:            return ["Gold Medal"]        if n == 2:            if nums[0] > nums[1]:                return ["Gold Medal", "Silver Medal"]            else:                return ["Silver Medal", "Gold Medal"]        nums2=nums[:]        nums2.sort()        nums2.reverse()        dict,ans={},[]        dict[nums2[0]]="Gold Medal"        dict[nums2[1]]="Silver Medal"        dict[nums2[2]]="Bronze Medal"        for i in range(3,n,1):            dict[nums2[i]]=str(i+1);        for i in range(n):            ans.append(dict[nums[i]])        return ans